import Athlete from "./Athlete";

const Results = ({athlete}) => {
    return  (
        <div className="results">
            {!athlete.length ? (
                <h1>No Athletes Found</h1>
            ) :  (
                        <Athlete 
                        name={name}
                        sport={sport}
                        id={id}
                        key={id}
                        sleepQuality={data.sleepQuality}
                        soreness={data.soreness}
                        date={date}
                        />
                    )
                }

            }
        </div>
    )
}

export default Results;
